function Home({ onLogout }) {
  return (
    <div className="card">
      <h2>Welcome to dashboard</h2>
      <p>You are logged in.</p>
      <button type="button" onClick={onLogout}>
        Logout
      </button>
    </div>
  );
}

export default Home;
